		//----------------------------------טעינת הסאונדים----------------------------------------------------
		
		createjs.Sound.registerSound("./sounds/badmp3.mp3", "soundBad"); 
		createjs.Sound.registerSound("./sounds/GameOvermp3.mp3", "soundGameOver");
