		ScreenOpen();  //הפעלת פונקציה שמציגה את מסך הפתיחה כולל הקומבו
		
		//------------------פונקציה ליצירת מסך הפתיחה------------------------------
		function ScreenOpen() {
			
			var screnOpen = new lib.screnOpen() //רקע
			screnOpen.name = "screnOpen"
			stage.addChild(screnOpen);
		
			var AllClouds = new lib.AllClouds() //עננים
			AllClouds.name = "AllClouds"
			stage.addChild(AllClouds)
		
			var perrisWheel = new lib.perrisWheel() //גלגל ענק
			perrisWheel.name = " perrisWheel"
			stage.addChild(perrisWheel)
		
			var circusTent = new lib.circusTent() //אוהל שמאל 
			circusTent.name = "circusTent"
			stage.addChild(circusTent)
		
			var HotAirBalloon = new lib.HotAirBalloon() //כדור פורח
			HotAirBalloon.name = "HotAirBalloon"
			stage.addChild(HotAirBalloon)
		
			var Carousel = new lib.Carousel() //קרוסלה
			Carousel.name = "Carousel"
			stage.addChild(Carousel)
			
			var horsesCarousel= new lib.horsesCarousel() //קרוסלת סוסים
			horsesCarousel.name = "horsesCarousel"
			stage.addChild(horsesCarousel)
			
			var smallCircusTent= new lib.smallCircusTent() //אוהל קטן 
			smallCircusTent.name = "smallCircusTent"
			stage.addChild(smallCircusTent)
		
			var hedge = new lib.hedge() //גדר
			hedge.name = "hedge"
			stage.addChild(hedge)
		
			var ticket = new lib.ticket() //דוכן כרטיסים 
			ticket.name = "ticket";
			stage.addChild(ticket);
				
			combo();//קיראה לפונקציית יצירת הקומבו
		}
		
		//--------------------פונקציה ליצירת הקומבו-------------------
		function combo(){
			
		forcombo = new lib.forcomb();	//יצירת הקומבו מהספרייה
		forcombo.x = 510; //מיקום הקומבו על הבמה
		forcombo.y = 450;
		stage.addChild(forcombo); //הוספת הקומבו לבמה
			
		forcombo.startbtn.alpha = 0.3; //הגדרות עבור כפתור "בחר" - חלק מהקומפוננטה של הקומבו
		
		//מאזין לשינוי ערכים בקומבו - שימו לב שהפרמטר השני, האינסטנס של הקומבו, הוגדר ידנית בתוך הקומפוננט
		$("#dom_overlay_container").on("change", "#mycb", mycb_change);
		}
		
		//פונקציה המאזינה לשינוי הערך בקומבו ובהתאם פועלת
		function mycb_change(evt) {
			console.log(evt.currentTarget.value);
			mychoice = evt.currentTarget.value; 	//שמירת הערך שנבחר בקומבו
			//אם נבחר הערך הראשון - "בחר נושא
			if (mychoice == 0) {
				forcombo.startbtn.alpha = 0.3;	//ניטרול כפתור בחר
				forcombo.startbtn.removeEventListener("click", fl_ClickToPosition); //נטרול לחיצה על כפתור הבחר
			} else {//בכל בחירה אחרת - כלומר בחר נושא תקין, נאפשר לחיצה
				forcombo.startbtn.alpha = 1;
				forcombo.startbtn.addEventListener("click", fl_ClickToPosition);//הפעלת קליק על כפתור הבחר
			}
		}
		
		//פונקציית קליק על כפתור בחר לאחר בחירת הנושא בקומבו
		function fl_ClickToPosition() {
			if (mychoice == 1) {
				firstGameFunc(); //קריאה למשחק ראשון
		
			} else if (mychoice == 2) {
				secondGameFunc();//קריאה למשחק שני
			}
		}
		
