		//----------------------------------------פונקצייה לחישוב הציון------------------------------------------
		function GradeFunc() {
			var n = myGame.length; //כמות סך כל המסיחים במערך
			var m = 0;//סוכם את התשובות השגויות הכולל פספוס ופגיעה בברווז לא נכון
		
			for (i = 0; i < myGame.length; i++) { //עובר על כל המערך וסוכם את השגיאות
				 if (myGame[i][1] == true && myGame[i][5] > 0) {//פספוס
					counterBadAns++;
				} else if (myGame[i][1] == false && myGame[i][5] > 0) {//פגיעה בברווז לא נכון
					counterBadAns++;
				}
			}
			
			m = counterBadAns;//סך כל השגיאות
			console.log(m+"כמות שגיאות");
		
			//חישוב הציון
			var finalGrade = parseInt(100 * (1 - m / n));
			if (finalGrade < 0) { //בודק אם הציון קטן מאפס
				Grade = 0;
			} else {
				Grade = finalGrade;
			}
		console.log(Grade+"ציון סופי")
		}
		
